/* eslint-disable prettier/prettier */
import styled from 'styled-components';

const IndexGrid = styled.div`
  #grid{
    display: grid;
    grid-gap: 0;
    grid-template-columns: 25vw 35vw 35vw 25vw;
    grid-template-rows: 50vh 50vh 50vh 50vh;

      #hoodies {
      grid-row: 1 / 2;
      grid-column: 1;
      padding: 0;
      margin: 0;
      max-height: 50vh;
      max-width: 25vw;
    }

    #dresses {
      grid-row: 3 / 4;
      grid-column: 1;
      padding: 0;
      margin: 0;
      max-height: 50vh;
      max-width: 25vw;
    }

    #footwear {
      grid-row: 1;
      grid-column: 2;
      padding: 0;
      margin: 0;
      max-height: 25vh;
      max-width: 35vw;
    }

    #shirts {
      grid-row: 1;
      grid-column: 3;
      padding: 0;
      margin: 0;
      max-height: 25vh;
      max-width: 35vw;
    }

    #kids {
      grid-row: 1 / 2;
      grid-column: 4;
      padding: 0;
      margin: 0;
      max-height: 50vh;
      max-width: 25vw;
    }

    #accessories {
      grid-row: 3 / 4;
      grid-column: 4;
      padding: 0;
      margin: 0;
      max-height: 50vh;
      max-width: 25vw;
    }

    #male {
      grid-row: 2 / 4;
      grid-column: 3;
      padding: 0;
      margin: 0;
      max-height: 75vh;
      max-width: 35vw;
    }

    #female {
      grid-row: 2 / 4;
      grid-column: 2;
      padding: 0;
      margin: 0;
      max-height: 75vh;
      max-width: 35vw;
    }
  }


`;

export default IndexGrid;
